    return (
        <div>
            {arr.map(user => {
                <div style={{width:'50rem',height:'20rem',backgroundColor:'gray'}}>
                <div class="card" style={{width: "18rem"}}>
                 <h3>{userName}</h3>
                 <h5>ARTEM</h5>
